import { v4 as uuidv4 } from 'uuid';

const initialCart = {
    carts: [],
    search: {
        type: 'All',
        input: '',
        max: 1000,
        min: 0,
    },
    myProducts: [],
    newProduct: {
        id: uuidv4(),
        name: '',
        img: '',
        cost: 0,
        type: 'All',
    },
    Products: [
        {
            id: uuidv4(),
            name: 'Blacket',
            type: 'Houseware',
            cost: 100,
            img: 'data:image/jpeg;base64,'
        },
        {
            id: uuidv4(),
            name: 'Phone',
            type: 'Phone',
            cost: 300,
            img: 'data:image/jpeg;base64,'
        },
        {
            id: uuidv4(),
            name: 'Laptop',
            type: 'Laptop',
            cost: 500,
            img: 'data:image/jpeg;base64,'
        },
        {
            id: uuidv4(),
            name: 'Airpod',
            type: 'Phone',
            cost: 100,
            img: 'data:image/jpeg;base64,'
        },
        {
            id: uuidv4(),
            name: 'Headphones',
            type: 'Laptop',
            cost: 200,
            img: 'data:image/jpeg;base64,'
        },
        {
            id: uuidv4(),
            name: 'Keyboard',
            type: 'Laptop',
            cost: 250,
            img: 'data:image/jpeg;base64,'
        },
        {
            id: uuidv4(),
            name: 'Micro USB',
            type: 'Phone',
            cost: 50,
            img: 'data:image/jpeg;base64,'
        },
    ],
}

const reducer = (state = initialCart, action) => {

    switch (action.type) {
        case 'buyProduct':
            console.log(state.Products)
            if (state.carts.length === 0) {
                let cart = {
                    ...action.payload
                }
                state.carts.push(cart);
            } else {
                let isCheck = true;
                state.carts.map((cart, index) => {
                    if (cart.id === action.payload.id) {
                        cart.quantity++
                        isCheck = false;
                    }
                })
                if (isCheck) {
                    state = {
                        ...state,
                        carts: [...state.carts, action.payload]
                    }
                }
            }
            return state;

        case 'deleteCart':
            let carts = state.carts
            carts.splice(action.payload, action.payload + 1)
            
            return {
                ...state,
                carts: [...carts]
            }
        case 'increaseCart':
            state.carts.map((cart, index) => {
                if (index === action.payload) {
                    cart.quantity++;
                }
            })
            return {
                ...state,
                carts: [...state.carts]
            }

        case 'reductionCart':
            state.carts.map((cart, index) => {
                if (index === action.payload) {
                    if (cart.quantity > 1) {
                        cart.quantity--;
                    } else {
                        state.carts.splice(action.payload, action.payload + 1)
                    }
                }
            })
            return {
                ...state,
                carts: [...state.carts]
            }
        case 'searchProductText':
            return {
                ...state,
                search: {
                    ...state.search,
                    input: action.payload
                }
            }
        case 'searchProductMax':
            return {
                ...state,
                search: {
                    ...state.search,
                    max: action.payload
                }
            }
        case 'searchProductMin':
            return {
                ...state,
                search: {
                    ...state.search,
                    min: action.payload
                }
            }
        case 'searchChangeType':
            return {
                ...state,
                search: {
                    ...state.search,
                    type: action.payload
                }
            }
        case 'addName':
            return {
                ...state,
                newProduct: {
                    ...state.newProduct,
                    name: action.payload,
                    id: uuidv4()
                }
            }
        case 'addImage':
            return {
                ...state,
                newProduct: {
                    ...state.newProduct,
                    img: action.payload
                }
            }
        case 'addCost':
            return {
                ...state,
                newProduct: {
                    ...state.newProduct,
                    cost: action.payload
                }
            }
        case 'addType':
            return {
                ...state,
                newProduct: {
                    ...state.newProduct,
                    type: action.payload
                }
            }
        case 'addNewProduct' :
            return {
                ...state,
                myProducts: [...state.myProducts, state.newProduct],
                Products: [...state.Products, state.newProduct],
            }
        case 'deleteMyProduct' :
            let { Products, myProducts } = state
            const productIndex = Products.findIndex((product) => {
                return product.id === action.payload
            })
            Products.splice(productIndex, productIndex + 1)
            const myProductIndex = myProducts.findIndex((myProduct) => {
                return myProduct.id === action.payload
            })
            myProducts.splice(myProductIndex, myProductIndex + 1)
            
            return {
                ...state,
                Products: [...Products],
                myProducts: [...myProducts]
            }
        default:
            return state

    }
}

export default reducer

